INSERT INTO `announcement` VALUES (1,'Invite by SPIC MACAY','SPIC MACAY is proud to present the concert of Vid. Kumaresh ji (on Violin) hosted at IIIT-B. Everybody is invited to be a part of this divine and soothing musical event. Date Friday 14th February, 2014'),(2,'Dance Competition','There\'s a Salsa dance competition on Monday.'),(3,'Ranji Tournament','There\'ll be selection for Ranji Matches on Wednesday.'),(4,'Michael Jordan Visit','Michael Jordan will be visiting IIIT-B next week.'),(5,'Modern Art','There\'ll be a modern art workshop by Zulfikar Ali in the first week of March'),(6,'Cooking Classes','Cooking classes from March 10. Enroll Soon.'),(7,'Chess Grandmaster Visit','Chess Grandmaster Vishwanathan Anand is visiting IIIT-B.'),(8,'Kayaking in Kerala','IIIT-B is organising a trip to Kerala for all the Kayak Enthusiasts in the next week.'),(9,'spandan 01','volleyball volunteers needed');
