INSERT INTO `interest` VALUES (1,'Cricket',''),(2,'Chess','Chess is a two-player strategy board game played on a chessboard, a checkered gameboard with 64 squares arranged in an eight-by-eight grid. It is one of the world\'s most popular games, played by millions of people worldwide at home, in parks, clubs, online, by correspondence, and in tournaments.'),(3,'Basketball','Basketball is a sport played by two teams of five players on a rectangular court. The objective is to shoot a ball through a hoop 18 inches (46 cm) in diameter and 10 feet (3.0 m) high mounted to a backboard at each end. Basketball is one of the world\'s most popular and widely viewed sports.'),(4,'Dance','Dance is a type of art that generally involves movement of the body, often rhythmic and to music. It is performed in many cultures as a form of emotional expression, social interaction, or exercise, in a spiritual or performance setting, and is sometimes used to express ideas or tell a story. Dance may also be regarded as a form of nonverbal communication between humans or other animals, as in bee dances and behaviour patterns such as a mating dances.'),(5,'Painting','Painting is the practice of applying paint, pigment, color or other medium[1] to a surface (support base). The medium is commonly applied to the base with a brush but other implements, such as knives, sponges, and airbrushes, can be used. Paintings may have for their support such surfaces as walls, paper, canvas, wood, glass, lacqu'),(6,'Cooking','Indian Cuisine'),(7,'Kayaking','Kayaking on Backwaters.'),(8,'spandan','Organizing Spandan');
