INSERT INTO `topic` VALUES (1,'This course will introduce UML concepts and diagrams through a case study. It will discuss MVC architecture, programming to interface, design principles in the context of building flexible software systems.',1),(2,'Students will build an object model as a case study for some game or some web application.',1),(3,'Students need to learn a modeling tool (like RSA, Netbeans etc.) and represent their model using the tool. Finally a working prototype should be developed in Java.',1),(4,'Depending on the focus, the course will also discuss the history of Web 2.0, its building blocks, RIA (AJAX, Flex, XAML), and building RIA applications (with Flex, coldfusion, and mashups).',1),(5,'The goal of this course is give an introduction to the fundamental issues and\r\ntechniques of numerical computation for mathematical, computational, and\r\nengineering problems.',2),(6,'Software Testing plays a critical role in the software development lifecycle. This\r\ncourse exposes students the various concepts, tools, and techniques in the area\r\nof software testing. Topics will include the role of testing in the SDLC, the\r\nverification versus validation, various types of testing, test automation and\r\nmanaging test results. The emphasis is on hands-on activities that apply the\r\nprinciples taught in the course.',3),(7,'Test Syllabus',4);
/*!40000 ALTER TABLE `topic` ENABLE KEYS */;
